import React, { Component, Fragment } from 'react';
import './Hability.css';

const Hability = function () {
    return <Fragment>
        <section id="hability">
            <h2>Habilidades</h2>
            <div id="hability-container">
                <p className="skill">AWS</p>
            </div>
        </section>
    </Fragment>;
}

export default Hability;
